// 'o|' - half note, lasts two beats
// '.|' - quater note, lasts one beat
// >>> parse_music(("o o| .| o| o| .| .| .| .| o o"))
// (std::vector<long>({(long)4, (long)2, (long)1, (long)2, (long)2, (long)1, (long)1, (long)1, (long)1, (long)4, (long)4}))
std::vector<long> parse_music(std::string music_string) {
    std::vector<long> beats;
    std::stringstream ss(music_string);
    std::string note;
    while (std::getline(ss, note, ' ')) {
        if (note == "o") {
            beats.push_back(4);
        } else if (note == "o|") {
            beats.push_back(2);
        } else if (note == ".|") {
            beats.push_back(1);
        }
    }
    return beats;

