// (true)
// 30 = 2 * 3 * 5
bool is_multiply_prime(long a) {
    if(a < 2) return false;
    int count = 0;
    for(int i = 2; i <= sqrt(a); i++) {
        if(a % i == 0) {
            count++;
            while(a % i == 0) a /= i;
        }
    }
    if(a > 1) count++;
    return count == 3;

