// Write a function that takes a vector of numbers as input and returns 
// the number of elements in the vector that are greater than 10 and both 
// first and last digits of a number are odd (1, 3, 5, 7, 9).
// For example:
// >>> specialFilter((std::vector<long>({(long)15, (long)-73, (long)14, (long)-15})))
// (1)
// >>> specialFilter((std::vector<long>({(long)33, (long)-2, (long)-3, (long)45, (long)21, (long)109})))
// (2)
long specialFilter(std::vector<long> nums) {
    long count = 0;
    for(long num : nums) {
        if(num > 10) {
            long abs_num = std::abs(num);
            long first_digit = abs_num;
            while(first_digit >= 10) {
                first_digit /= 10;
            }
            long last_digit = abs_num % 10;
            if(first_digit % 2 != 0 && last_digit % 2 != 0) {
                count++;
            }
        }
    }
    return count;

