// (2)
long specialFilter(std::vector<long> nums) {
    long count = 0;
    for(long num : nums) {
        if(num > 10) {
            long abs_num = std::abs(num);
            long last_digit = abs_num % 10;
            long first_digit = abs_num;
            while(first_digit >= 10) {
                first_digit /= 10;
            }
            if(first_digit % 2 != 0 && last_digit % 2 != 0) {
                count++;
            }
        }
    }
    return count;

